function App() {
  return (
    <div className="App">
      <h2>Lista de tarefas</h2>
      <InputTarefas/>      
      <ul>        
        <li>{this.props.tarefaImpressa}</li>
        <li>Tarefa2</li>
        <li>Tarefa3</li>
      </ul>
    </div>
  );
}

export default App;
